import { useState } from "react";
import axios from "axios";
import { toast } from "react-hot-toast";
import { Link } from "react-router-dom";

const Register = () => {
    const [email, setEmail] = useState('');
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [age, setAge] = useState('');



    const helloReg = (e) => {
        e.preventDefault(); // stops the default behaviour i.e refresh
        const userData = {
            username, password, age, email
        }
        axios.post("http://localhost:8080/customer/insert", userData)
            .then(result => {
                if (result.data.success) {
                    //registered success
                    // setMessage('Registered Successfully')
                    toast.success('register successfully')
                }
                else {
                    // not registered
                    // setMessage('Something went wrong! Please try again!');
                    toast.error('something went wrong! plese try again')
                }
            })
            .catch(e => {
                // setMessage('Something went wrong! Please try again!');


            })
    }

    const login = (e) =>{
        e.preventDefault();

    }

    return (
        <div>
            <div className="container mb-3">
                {/* <div className="row"></div> */}
                <div className="row">
                    <div className="col-md-6 mt-5">
                        <img className="img-fluid" src={'https://d2441bdvuxbh7t.cloudfront.net/web/images/grepper_and_logo.jpeg'}></img>
                    </div>
                    <div className="col-md-6 mt-5">
                        {/* <p>{message}</p> */}

                        <span className="go">Progulf Lubricants</span>
                        <h2 className="wel mt-4">Welcome, create an account</h2>

                        <form>

                            <div className="form-group">
                                <label>Email</label>
                                <input type="text" className="form-control"
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                />
                            </div>

                            <div className="form-group">
                                <label>Username</label>
                                <input type="text" className="form-control"
                                    value={username}
                                    onChange={(e) => setUsername(e.target.value)}
                                />
                            </div>

                            <div className="form-group">
                                <label>Password</label>
                                <input type="password" className="form-control"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                />
                            </div>

                            <div className="form-group">
                                <label>Age</label>
                                <input type="text" className="form-control"
                                    value={age}
                                    onChange={(e) => setAge(e.target.value)}
                                />
                            </div>
                            <button type="button" className="sub btn btn-primary" onClick={helloReg}>Submit</button>
                            <div className="he">
                                <span>or</span>
                            </div>
                        <Link to="/login">
                            <button type="button" className="sub btn btn-success">Login</button>
                        </Link>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Register;
